export class WebSocketEventEnum
{
    public static CONNECTION_OPENED = 'open';
    public static CONNECTION_CLOSED = 'close';
    public static CONNECTION_ERROR = 'error';
    public static CONNECTION_MESSAGE = 'message';
}
